import React from 'react';
import images from "../Utilities/ImageDirectories/CampusWatchImages.json"

function Page() {
  return (
    <div className="min-h-screen flex flex-col">
      <header className="bg-gray-200 py-4 px-8">
        <h1 className="text-3xl font-bold">OUTREACHES</h1>
      </header>
      <main className="flex-1 flex flex-col items-center justify-center py-20">
        <div className="text-center mb-10">
          <p className="text-lg">To deliver the future of the youth from the strongman of the spirit, re-activating the alter of prophetic/ decla</p>
        </div>
        <div className="flex justify-center mb-10">
          {
            images.map((image, index) => {
                <img src={image.url} className='h-96 w-96 object-cover rounded-lg'/>
            })
          }
        </div>
      </main>
    </div>
  );
}

export default Page;
